- input: "TEXT\x1CC00100644\x1C.TEXT\x1C\x1CF3XN\x1CThis March 20 (2/1/13-2/28/13)
    monthly report does not disclose any payments or wages on Schedule B supporting
    line 30(b) of the Detailed Summary Report because the committee does not have
    any employees who spend more than 25 percent of thier time on Federal Election
    \ Activity.                                                                                                                                 Per
    phone conversation with RAD, the allocation ratio for administrative expenses
    is governed per the date when the expense was incurred; not by the date when the
    expense and allocation is paid.  Therefore, this March 20 monthly report contains
    two H1 allocation schedules due to the fact that some accrued expenses (debts)
    that were paid in this month were actually incurred in a previous allocation ratio
    period.\n"
